import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Usuarios = () => {
  const navigate = useNavigate();
  
  const [usuarios, setUsuarios] = useState([
    {
      id: 1,
      nome: 'João Silva',
      email: 'joao@example.com',
      criadoEm: '2025-05-10'
    },
    {
      id: 2,
      nome: 'Maria Santos',
      email: 'maria@example.com',
      criadoEm: '2025-05-12'
    },
    {
      id: 3,
      nome: 'Pedro Oliveira',
      email: 'pedro@example.com',
      criadoEm: '2025-05-15'
    },
    {
      id: 4,
      nome: 'Ana Costa',
      email: 'ana@example.com',
      criadoEm: '2025-05-18'
    }
  ]);

  const handleNovoUsuario = () => {
    navigate('/novo-usuario');
  };

  const handleEditarUsuario = (id) => {
    navigate(`/editar-usuario/${id}`);
  };

  const handleExcluirUsuario = (id) => {
    if (window.confirm('Tem certeza que deseja excluir este usuário?')) {
      setUsuarios(prev => prev.filter(user => user.id !== id));
      alert('Usuário excluído com sucesso!');
    }
  };

  return (
    <div className="px-40 flex flex-1 justify-center py-5">
      <div className="layout-content-container flex flex-col max-w-[960px] flex-1">
        <div className="flex flex-wrap justify-between gap-3 p-4">
          <p className="text-[#0d141c] tracking-light text-[32px] font-bold leading-tight min-w-72">Usuários</p>
          <button
            onClick={handleNovoUsuario}
            className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-lg h-8 px-4 bg-[#e7edf4] text-[#0d141c] text-sm font-medium leading-normal hover:bg-[#d0dae5] transition-colors"
          >
            <span className="truncate">Novo Usuário</span>
          </button>
        </div>
        
        <div className="px-4 py-3">
          <div className="flex overflow-hidden rounded-lg border border-[#cedbe8] bg-slate-50">
            <table className="flex-1 w-full">
              <thead>
                <tr className="bg-slate-50">
                  <th className="px-4 py-3 text-left text-[#0d141c] text-sm font-medium leading-normal w-1/3">
                    Nome
                  </th>
                  <th className="px-4 py-3 text-left text-[#0d141c] text-sm font-medium leading-normal w-1/3">
                    Email
                  </th>
                  <th className="px-4 py-3 text-left text-[#0d141c] text-sm font-medium leading-normal w-1/6">
                    Criado em
                  </th>
                  <th className="px-4 py-3 text-left text-[#0d141c] text-sm font-medium leading-normal w-1/6">
                    Ações
                  </th>
                </tr>
              </thead>
              <tbody>
                {usuarios.length === 0 ? (
                  <tr>
                    <td colSpan="4" className="h-[72px] px-4 py-2 text-center text-[#49739c] text-sm font-normal leading-normal">
                      Nenhum usuário encontrado.
                    </td>
                  </tr>
                ) : (
                  usuarios.map((usuario) => (
                    <tr key={usuario.id} className="border-t border-t-[#cedbe8] hover:bg-[#f1f5f9] transition-colors">
                      <td className="h-[72px] px-4 py-2 text-[#0d141c] text-sm font-normal leading-normal">
                        {usuario.nome}
                      </td>
                      <td className="h-[72px] px-4 py-2 text-[#49739c] text-sm font-normal leading-normal">
                        {usuario.email}
                      </td>
                      <td className="h-[72px] px-4 py-2 text-[#49739c] text-sm font-normal leading-normal">
                        {new Date(usuario.criadoEm).toLocaleDateString('pt-BR')}
                      </td>
                      <td className="h-[72px] px-4 py-2">
                        <div className="flex gap-2">
                          <button
                            onClick={() => handleEditarUsuario(usuario.id)}
                            className="text-sm font-medium text-[#0c7ff2] hover:text-[#0a6cd9] transition-colors"
                          >
                            Editar
                          </button>
                          <button
                            onClick={() => handleExcluirUsuario(usuario.id)}
                            className="text-sm font-medium text-[#dc2626] hover:text-[#b91c1c] transition-colors"
                          >
                            Excluir
                          </button>
                        </div>
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>
          </div>
        </div>

        {usuarios.length > 0 && (
          <div className="px-4 py-2">
            <p className="text-[#49739c] text-sm font-normal leading-normal">
              Total de usuários: {usuarios.length}
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Usuarios;
